import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div className='jumbotron'>
            <h2>Home Page</h2>
            <Link to='/about' className='btn btn-primary mt-3'>
                About
            </Link>
        </div>
    );
};

export default Home;
